$_MODULE['<{ntbackupandrestore}prestashop>dropbox_f2a6c498fb90ee345d997f888fce3b18'] = 'Supprimer';
$_MODULE['<{ntbackupandrestore}prestashop>faq_1fe917b01f9a3f87fa2d7d3b7643fac1'] = 'FAQ';
$_MODULE['<{ntbackupandrestore}prestashop>faq_96d45a338ff7b992b596577083f9d114'] = 'A quelle fréquence, l\'automatisation par 2N est elle faite ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_51452b6d1f8511cf289eb01753eda3bb'] = 'L\'automatisation par 2N est faite chaque jour';
$_MODULE['<{ntbackupandrestore}prestashop>faq_42027eaa203032a09ccc5048897c677c'] = 'L\'automatisation par 2N ne semble plus fonctionner, que puis je faire ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_ffebb8fcef9bdccc3aeac353e6d78be7'] = 'Veuillez essayer de sauvegarder à nouveau l\'automatisation';
$_MODULE['<{ntbackupandrestore}prestashop>faq_41906c69303e903c986fde8f7cb34665'] = 'La sauvegarde se termine par une erreur indiquant qu\'il n\'y a pas suffisamment de place pour la sauvegarde, mais je sais qu\'il y en a. Pourquoi ai je cette erreur ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_8bdbb9087cc2864414759889f6d22307'] = 'Cette erreur peut être causée par une limite de votre serveur. Certains serveurs (32 bits) n\'autoriseront pas la sauvegarde à faire plus de 2Go. Dans ce cas, vous pouvez utiliser les options avancées pour limiter la taille de la sauvegarde. Votre sauvegarde sera coupée en parties plus petites qui seront acceptées par votre serveur. Par exemple, vous pouvez choisir 1500 comme taille limite pour votre fichier de sauvegarde. N\'oubliez pas que toutes les parties générées sont nécessaires à la restauration de votre boutique.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_afde1c7273735610102d9f166386b91e'] = 'Où puis je trouver la sauvegarde sur mon serveur ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_c99296863a8cfebedbf941a80b149eb3'] = 'Vous pouvez trouver votre sauvegarde dans le dossier modules/ntbackupandrestore/backup/ par défaut, ou dans le dossier que vous avez configuré dans la configuration avancée.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_6162f1ad35f8d68d2ad18e65d6af12ca'] = 'Où puis je trouver le fichier de la base de données dans ma sauvegarde ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_259f134b1c3cb0f4211d27812fb4f339'] = 'Quand vous créez une sauvegarde complète, votre base de données est sauvegardée avec tous les autres fichiers dans le fichier de sauvegarde. Si vous voulez vérifier, décompressez votre fichier de sauvegarde sur votre ordinateur, vous pouvez trouver le fichier dump.sql dans le dossier modules/ntbackupandrestore/backup/';
$_MODULE['<{ntbackupandrestore}prestashop>faq_92a654ecc8f654ec6377f7a48b155a4a'] = 'La sauvegarde complete contient elle vraiment tous mes fichiers et données ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_9b1606163135003f78f33d752ffb892c'] = 'La sauvegarde complète contiendra une copie exacte de votre site web. C\'est à dire tous vos fichiers et données. Sauf si vous avez configuré le module de manière à ne pas sauvegarder certains d\'entre eux';
$_MODULE['<{ntbackupandrestore}prestashop>faq_d50856eaf5567a344aafac6b6629a581'] = 'Comment puis je vérifier que ma sauvegarde est valide ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_d2a25247fc786e9f6a27212ee9aed0b8'] = 'Le meilleur moyen de vérifier que votre sauvegarde est valide, est de tenter de la restaurer ailleurs. Par exemple, sur un nouveau domaine et nouvelle base de données ou sur votre ordinateur avec Wamp, Mamp, Easyphp ou autres logiciels de serveur local.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_b26bae87fdb843d75a120d12fe51ffa6'] = 'Comment puis je restaurer ma sauvegarde ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_84d3c56657e5438d10f92c3d36c5cf8b'] = 'Pour restaurer votre sauvegarde vous devez :';
$_MODULE['<{ntbackupandrestore}prestashop>faq_261aa829c8bd1bd4216bf09dc76f7326'] = 'Choisir où votre boutique doit être restaurée. Soit un nouvel emplacement (nouveau domaine et nouvelle base de données) pour copier/déplacer ou à la racine de votre boutique actuelle pour la remplacer.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_0c02578d80e75b15e3c2fafda964bfe4'] = 'Placer votre sauvegarde et script de restauration à l\'emplacement choisi';
$_MODULE['<{ntbackupandrestore}prestashop>faq_967e66ec729f29106f185bf0e5c9c267'] = 'Accéder au script de restauration, en utilisant votre navigateur web';
$_MODULE['<{ntbackupandrestore}prestashop>faq_96c158c212b69d93f4bf51a208b7c6b0'] = 'Indiquer les informations d\'accès de la base de données où les données seront restaurées.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_3438a63edfc1456e8bff9b8a75f0f8c2'] = 'Optionnel : si besoin, configurer les options avancées';
$_MODULE['<{ntbackupandrestore}prestashop>faq_0b20e24f98a55bf66d6fe76363284591'] = 'Lancer la restauration. N\'oubliez pas que les fichiers de votre sauvegarde écraseront et remplaceront les fichiers et données existants par ceux de votre sauvegarde.';
$_MODULE['<{ntbackupandrestore}prestashop>faq_3eff3a1acbbcd5b69a0b1371e9de4e0a'] = 'Je n\'ai pas assez d\'espace sur mon serveur pour la sauvegarde, puis je l\'envoyer directement sur un de mes comptes distants (%1$s, %2$s...) ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_e90b4c705ffae4ec9f27abfa38a8b96d'] = 'Avant de pouvoir être envoyée sur un compte distant, la sauvegarde doit être créée sur votre serveur. Vous devez avoir au moins la place pour une sauvegarde. Vous pouvez choisir dans la configuration avancée l\'option permettant la suppression automatique de la sauvegarde si elle est envoyée sur un compte distant';
$_MODULE['<{ntbackupandrestore}prestashop>faq_6510898b2f7a8fa6fe8aeafb9ea5ca4d'] = 'Pour restaurer ma boutique, dois je d\'abord installer un Prestashop vierge ?';
$_MODULE['<{ntbackupandrestore}prestashop>faq_2f8b950c8cb11678dd68bd1050f15034'] = 'Vous n\'avez pas besoin d\'installer un Prestashop vierge pour restaurer. Vous avez seulement besoin de votre fichier de sauvegarde et de votre script de restauration.';
$_MODULE['<{ntbackupandrestore}prestashop>ftp_f61a38fa914787455edd1dd7e5908650'] = 'Envoyer la sauvegarde sur un compte %1$s.';
